// ---- Plasma colormap (6-stop approximation) ----
function dayColor(d, maxD) {
    const stops = [
        [0.0, [13,8,135]], [0.2, [106,0,168]], [0.4, [177,42,144]],
        [0.6, [225,100,98]], [0.8, [252,166,54]], [1.0, [240,249,33]]
    ];
    const t = Math.min(d / Math.max(maxD, 1), 1);
    let i = 0;
    for (let s = 1; s < stops.length; s++) { if (t <= stops[s][0]) { i = s - 1; break; } if (s === stops.length - 1) i = s - 1; }
    const [t0, c0] = stops[i], [t1, c1] = stops[i + 1];
    const f = (t - t0) / (t1 - t0);
    const r = Math.round(c0[0] + f * (c1[0] - c0[0]));
    const g = Math.round(c0[1] + f * (c1[1] - c0[1]));
    const b = Math.round(c0[2] + f * (c1[2] - c0[2]));
    return `rgb(${r},${g},${b})`;
}

// ---- Map setup ----
const map = L.map('map', { zoomControl: true }).setView([25, -80], 5);
const streets = L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {attribution:''});
const satellite = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}', {attribution:'Esri'});
const dark = L.tileLayer('https://{s}.basemaps.cartocdn.com/dark_all/{z}/{x}/{y}{r}.png', {attribution:''});
dark.addTo(map);

L.control.layers({'Street': streets, 'Satellite': satellite, 'Dark': dark}, {}, {collapsed: true}).addTo(map);
L.control.scale().addTo(map);

// ---- Layer groups ----
let trajLayer = L.layerGroup().addTo(map);
let pointsLayer = L.layerGroup().addTo(map);
let lowLayer = L.layerGroup();
let habitatCellsLayer = L.layerGroup().addTo(map);
let habitatVisitsLayer = L.layerGroup().addTo(map);
let markersLayer = L.layerGroup().addTo(map);

// Draw habitat cells once
HABITAT_CELLS.forEach(h => {
    L.rectangle([[h.miny, h.minx],[h.maxy, h.maxx]], {
        color:'#1a8c32', fillColor:'#33cc66', fillOpacity:0.25, weight:1
    }).bindPopup('<b>' + h.beach + '</b>').addTo(habitatCellsLayer);
});

// ---- Populate dropdown ----
const sel = document.getElementById('pidSelect');
PARTICLES.forEach((p, i) => {
    const opt = document.createElement('option');
    opt.value = i;
    opt.textContent = `${p.pid}`;
    sel.appendChild(opt);
});

// ---- Load a particle ----
function loadParticle(idx) {
    const p = PARTICLES[idx];
    const maxD = p.duration;

    // Clear layers
    trajLayer.clearLayers();
    pointsLayer.clearLayers();
    lowLayer.clearLayers();
    habitatVisitsLayer.clearLayers();
    markersLayer.clearLayers();

    // Trajectory polyline (colored segments)
    const traj = p.traj;
    for (let i = 0; i < traj.length - 1; i++) {
        const [lat1, lon1, d1] = traj[i];
        const [lat2, lon2] = traj[i + 1];
        L.polyline([[lat1, lon1], [lat2, lon2]], {
            color: dayColor(d1, maxD), weight: 3, opacity: 0.8
        }).addTo(trajLayer);
    }

    // Day points
    p.points.forEach(pt => {
        const col = dayColor(pt.d, maxD);
        const popup = `<b>Day ${pt.d}</b><br>Lat: ${pt.lat}<br>Lon: ${pt.lon}<br>`
            + `Daily: ${pt.dist} km<br>Cumulative: ${pt.cum} km`
            + (pt.low ? '<br>âš ï¸ LOW MOVEMENT' : '');
        L.circleMarker([pt.lat, pt.lon], {
            radius: 5, color: col, fillColor: col, fillOpacity: 0.9
        }).bindPopup(popup).addTo(pointsLayer);

        if (pt.low) {
            L.circleMarker([pt.lat, pt.lon], {
                radius: 6, color: 'white', fillColor: 'white', fillOpacity: 0.7
            }).bindPopup(`Day ${pt.d} | ${pt.dist} km`).addTo(lowLayer);
        }
    });

    // Habitat visits
    (p.habitat_visits || []).forEach(hv => {
        L.marker([hv.lat, hv.lon], {
            icon: L.icon({iconUrl:'https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-green.png', iconSize:[25,41], iconAnchor:[12,41]})
        }).bindPopup(`<b>Day ${hv.day}</b><br>Beach: ${hv.beach}`).addTo(habitatVisitsLayer);
    });

    // Start marker
    L.marker([p.start_lat, p.start_lon], {
        icon: L.icon({iconUrl:'https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-green.png', iconSize:[25,41], iconAnchor:[12,41]})
    }).bindPopup(`<b>START â€” Day 0</b><br>(${p.start_lat}, ${p.start_lon})`).addTo(markersLayer);

    // End marker
    const wtxt = p.mpw_end !== null ? `<br>MPW: ${p.mpw_end} tons` : '';
    L.marker([p.end_lat, p.end_lon], {
        icon: L.icon({iconUrl:'https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-red.png', iconSize:[25,41], iconAnchor:[12,41]})
    }).bindPopup(`<b>FROZEN â€” Day ${p.freeze_day}</b><br>(${p.end_lat}, ${p.end_lon})<br>Distance: ${p.total_dist} km` + wtxt).addTo(markersLayer);

    // Fit bounds
    const lats = p.traj.map(t => t[0]);
    const lons = p.traj.map(t => t[1]);
    map.fitBounds([[Math.min(...lats), Math.min(...lons)], [Math.max(...lats), Math.max(...lons)]], {padding: [40, 40]});

    // Update header
    updateStats(p);
}

function updateStats(p) {
    const mpwStart = p.mpw_start !== null ? `<span><b>MPW start:</b> ${p.mpw_start} tons</span>` : '';
    const mpwEnd = p.mpw_end !== null ? `<span><b>MPW end:</b> ${p.mpw_end} tons (decay: ${p.mpw_decay})</span>` : '';
    const nestBeach = p.beach_name ? `<span><b>Nesting Beach:</b> ${p.beach_name}</span>` : `<span><b>Nesting Beach:</b> None</span>`;

    document.getElementById('statsRows').innerHTML = `
        <div class="stats-row">
            <span><b>Release:</b> ${p.release}</span>
            <span><b>Duration:</b> ${p.duration} days</span>
            <span><b>Total distance:</b> ${p.total_dist} km</span>
            <span><b>Start:</b> (${p.start_lat_str}, ${p.start_lon_str})</span>
            <span><b>End:</b> (${p.end_lat_str}, ${p.end_lon_str})</span>
        </div>
        <div class="stats-row">
            <span><b>Low-movement days:</b> ${p.low_days}</span>
            ${mpwStart} ${mpwEnd} ${nestBeach}
        </div>`;

    // Colorbar
    const d = p.duration;
    document.getElementById('cbLabel').textContent = `Day (0â€“${d})`;
    document.getElementById('cbTicks').innerHTML =
        `<span>0</span><span>${Math.floor(d/4)}</span><span>${Math.floor(d/2)}</span><span>${Math.floor(3*d/4)}</span><span>${d}</span>`;

    // Mobile stats
    document.getElementById('mobileStats').innerHTML = `
        <span><b>Release:</b> ${p.release}</span>
        <span><b>Duration:</b> ${p.duration} days</span>
        <span><b>Total distance:</b> ${p.total_dist} km</span>
        <span><b>Low-movement days:</b> ${p.low_days}</span>
        ${mpwStart} ${mpwEnd}
        <span><b>Start:</b> (${p.start_lat_str}, ${p.start_lon_str})</span>
        <span><b>End:</b> (${p.end_lat_str}, ${p.end_lon_str})</span>
        ${nestBeach}`;
    document.getElementById('mobileStats').classList.remove('visible');
    document.getElementById('mobileStats').classList.add('hidden');
}

function toggleMobileStats() {
    const el = document.getElementById('mobileStats');
    el.classList.toggle('visible');
}

// Close mobile stats on map click
map.on('click', () => {
    document.getElementById('mobileStats').classList.remove('visible');
});

// Load first particle
if (PARTICLES.length > 0) loadParticle(0);
</script>
